import './App.css';

function App() {
  return (
    <div>
    <div className='banner'>
      <h1>DESIGN IS MY LIFE</h1>
    </div>
    <ul>
      <li className='list'>
        <input type="checkbox" id='facebook'></input>
        <label for = "facebook">Facebook</label>
      </li>
    </ul>
    </div>
  );
}

export default App;
